import styles from "./hex.css"

export function HexComponent() {

  return (
    <svg height="300" width="100%">
                 		<polygon style={styles.hex} className="hex" points="300,150 225,280 75,280 0,150 75,20 225,20"
                 		stroke="black"
            			fill="yellow"stroke-width="5" />
               	</svg>
  );
}
